window.bookSummaryJSON = "Here is an opportunity to explore part of the healing equation overlooked by conventional medicine - the spirit's unlimited capacity for self-healing and divine connection. This enlightening recording teaches you to view your health through a spiritual-biological lens to see a new picture of how the human body heals. In 12 step-by-step sessions, Dr. Caroline Myss presents every phase of her groundbreaking work on energy medicine, including the \"map\" of your body's seven energy centers, its relationship to sacred texts and divine power, and principles of intuitive diagnosis."; 
